import React from 'react'
import '../App.css'
export default function Footer() {
    const font =  "'Quicksand', sans-serif";
    var footStyle = {
        background: "violet",
        height: "200px"
    }
    return <div className = "container-fluid" style = {footStyle}>
        <div className = "row">
            <div className = "col-md-6" style = {{fontFamily: font}}>
                Library Management System
            </div>
        </div>
    </div>
}
